import { useLayoutEffect } from 'react';

const Wishlist = ({setShowNavbar}) => {

  useLayoutEffect(() => {
    setShowNavbar(false);
}, [])
  return (
    <div>
        <h1> Wishlist </h1>
    </div>
  )
}

export default Wishlist
